  u_char *
  MakeQuantHeader(u_char *p, u_char *qt, int tableNo)
  {
          *p++ = 0xff;
          *p++ = 0xdb;            /* DQT */
          *p++ = 0;               /* length msb */
          *p++ = 67;              /* length lsb */
          *p++ = tableNo;
          memcpy(p, qt, 64);
          return (p + 64);
  }
